                if (blues[parent] == undefined) {
                    blues[parent] = 255
                }
                visited.add(parent)
                $(".arrow-" + parent).show()
                $("#" + parent).css("background-color", "rgb(150, " + blues[parent] + ", " + blues[parent] + ")")
